// import React, { useRef, useState } from "react";
import React from "react";

// Import Swiper React components
import { Swiper, SwiperSlide } from "swiper/react";

// Import Swiper styles
import "swiper/css";
import "swiper/css/pagination";

import "./slideraperture.css";

// import required modules
import { Pagination } from "swiper/modules";

import aperture_1 from "./img/aperture-1.jpg";
import aperture_2 from "./img/aperture-2.jpg";
import aperture_3 from "./img/aperture-3.jpg";
import aperture_4 from "./img/aperture-4.jpg";

export default function Slideraperture() {
  return (
    <Swiper
      slidesPerView={"auto"}
      spaceBetween={30}
      pagination={{
        clickable: true,
      }}
      modules={[Pagination]}
      className="mySwiper_a"
    >
      <SwiperSlide>
        <img src={aperture_1} alt="slider_image" />
      </SwiperSlide>
      <SwiperSlide>
        <img src={aperture_2} alt="slider_image" />
      </SwiperSlide>
      <SwiperSlide>
        <img src={aperture_3} alt="slider_image" />
      </SwiperSlide>
      <SwiperSlide>
        <img src={aperture_4} alt="slider_image" />
      </SwiperSlide>
    </Swiper>
  );
}
